import { EditOutlined } from '@ant-design/icons';
const { Meta } = Card;
const Mention = () => {
    return(
        <div>
            <Card
            title="I mentioned..."
    style={{
        width: 300, float: 'left', marginLeft: 17, marginTop: 30}}
        extra={<a href="#">More</a>}
        cover={
      <img
        alt="example"
        src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
        height='200px'
      />
    }
  >
  </Card>
        </div>
    );
};

export default Mention;
